import React, { useState, useEffect } from "react";
import PropTypes from "prop-types";
import clsx from "clsx";
import { makeStyles, withStyles } from "@material-ui/styles";
import { Button, Grid, colors, Divider } from "@material-ui/core";
import AddRounded from "@material-ui/icons/AddRounded";
import ToggleButton from "@material-ui/lab/ToggleButton";
import ToggleButtonGroup from "@material-ui/lab/ToggleButtonGroup";
import Snackbar from "@material-ui/core/Snackbar";
import MuiAlert from "@material-ui/lab/Alert";
import NewCompentModal from "./AddElements/NewCompentModal";


const useStyles = makeStyles((theme) => ({
  root: {},
  row: {
    height: "42px",
    display: "flex",
    alignItems: "center",
    marginTop: theme.spacing(1),
  },
  spacer: {
    flexGrow: 1,
  },
  divider: {
    margin: 20,
    height: 3,
  },
  importButton: {
    marginRight: theme.spacing(1),
  },
  exportButton: {
    marginRight: theme.spacing(1),
  },
  searchInput: {
    marginRight: theme.spacing(1),
  },
  center: {
    marginTop: 10,
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
}));


const ImportExternal = (props) => {
  const { className, onChange, components, modifiyngStock, ...rest } = props;

  const classes = useStyles();
  const [component, setComponent] = useState("aop");
  const [openAlert, setOpenAlert] = useState(false);
  const [openNewModal, setOpenNewModal] = useState(false);
  const [componentInfo, setComponentInfo] = useState({});

  const getDocument = (document) => {
   console.log('get')
  };

  return (
    <div {...rest} className={clsx(classes.root, className)}>

      <Button variant="outlined" onClick={getDocument()}>Update from musicDing</Button>
    </div>
  );
};

ImportExternal.propTypes = {
  className: PropTypes.string,
  onChange: PropTypes.func,
};

export default ImportExternal;
